function List(props){
    
    const fruits = props.item;
    const length = props.length;
    const listItems = fruits.map(fruit => <li>{fruit}</li>)
    return (
        <>
        {length > 0 ? <ol>{listItems}</ol> : <div>there is no item in that list!</div>}
        </>
        // showFruit(fruits)
        
    );
}
export default List;
